import React, { useState, useEffect, useContext } from "react";
import Login from './pages/Login.js'
import Register from './pages/Register.js'
import Console from "./pages/Console.js";
import Navbar from './pages/nav/Navbar.js'
import Profile from './pages/Profile.js'
import Wallet from './pages/Wallet.js'
import { AuthContext } from "./context/AuthContext.js";
import { Route, Redirect, Routes, useNavigate} from 'react-router-dom';
import Cookies from "js-cookie";
import PrivateRoute from "./PrivateRoute/index.js";

const App = () => {
  const [currentForm, setCurrentForm] = useState('login');
  const [isAuthenticated, setIsAuthenticated] = useState('');
  const { user } = useContext(AuthContext);
  let navigate = useNavigate();

  return (
    <div className="App">
      <div>
        <Navbar/>
      </div>
      <div className="App-contents">
        <Routes>
          <Route path="/login" element={<Login/>}/>
          <Route path="/register" element={<Register/>}/>
          <Route path="/console" element={<PrivateRoute><Console/></PrivateRoute> } />
          <Route path="/profile" element={<PrivateRoute><Profile/></PrivateRoute> } />
          <Route path="/wallet" element={<PrivateRoute><Wallet/></PrivateRoute> } />
        </Routes>
      </div>
    </div>
  );
}

export default App;
